  \"2013-03-15T23:34:40.009837\",\n\t\"name\": \"geothermal-energy-at-long-beach-naval-shipyard-and-naval-station-and-at-seal-beach-naval-weapon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The main purpose of this study was to determine
  the characteristics of geothermal energy beneath two military bases in southern
  California operated by the U.S. Department of the Navy. One base, the Long Beach
  Naval Shipyard and Naval Station is in Los Angeles County, while the other, the
  Seal Beach Naval Weapons Station, is in Orange County, about 10 kilometers away
  (Figure 1). Parts of both naval bases are situated within oil fields, the former
  in Wilmington Oil Field, the latter in Seal Beach Oil Field. An important part of
  the study involved the oilfield operations on and immediately adjacent to the bases;
  these were also investigated as potential sources of geothermal energy. Open File
  Report OFR84-32_Report, 4 Plates. Document available for purchase online from CAGS.
  Category: Open File Report. For more information see links provided. \",\n\t\"license_title\":
